column3:
Θέλετε να καταργήσετε τις παρακάτω τροφοδοσίες RSS από το Outlook;

%s

Τα στοιχεία που λάβατε προηγουμένως από αυτές τις τροφοδοσίες RSS δεν διαγράφονται.

Θέλετε να καταργήσετε τις παρακάτω λίστες από όλους τους υπολογιστές που χρησιμοποιείτε;

%s

Όλες οι αλλαγές που κάνατε μετά την τελευταία Αποστολή/Παραλαβή θα χαθούν. Τα περιεχόμενα κάθε λίστας θα παραμείνουν στο διακομιστή.

Θέλετε να διακόψετε τη δημοσίευση των παρακάτω ημερολογίων και να τα αφήσετε στο διακομιστή;

%s

Για να καταργήσετε ένα ημερολόγιο από το διακομιστή

column5:
 αφού κλείσετε το στοιχείο.

Είστε βέβαιοι ότι θέλετε να κλείσετε το στοιχείο;

Για περισσότερες πληροφορίες

column3:
Είστε βέβαιοι ότι θέλετε να καταργήσετε τους παρακάτω κοινόχρηστους φακέλους ή λογαριασμούς από το Outlook;

<0w>

Όλοι οι φάκελοι και λογαριασμοί θα διαγραφούν από τον υπολογιστή σας.
